import React, { useState } from "react";

export default function RadioButtons() {
  function handleClick(e) {
    e.preventDefault();
    console.log("Clickk");
  }

  return (
    <form>
      <div>
        <input
          type="radio"
          id="texttChoice1"
          name="text"
          value="lyric"
          onClick={handleClick}
        />
        <label htmlFor="contactChoice1">Lyric</label>
        <input type="radio" id="contactChoice2" name="text" value="poem" />
        <label htmlFor="contactChoice2">Poem</label>
        <input type="radio" id="contactChoice3" name="text" value="quote" />
        <label htmlFor="contactChoice3">Quote</label>
      </div>
    </form>
  );
}
